"use strict";
Page({
    data: {
        val: 0
    },
    sendVal() {
        const num = Number(this.data.val);
        if (Number.isNaN(num)) {
            wx.showModal({
                title: '输入错误',
                content: '值必须是整数',
                success: () => {
                    this.setData({
                        val: 0
                    });
                }
            });
        }
        else {
            const event = this.getOpenerEventChannel();
            event.emit("valueOk", { val: this.data.val });
            wx.navigateBack();
        }
    }
});
